import Link from "next/link";

const nav = () => {
    return (
        <nav className="d-flex justify-content-between align-items-center pl-3 pr-3">
            <Link href="/"><a className="mr-2" href="#">홈</a></Link>
            <div className="header__navitem">
                <a>랭킹</a>
                <ul className></ul>
            </div>
            <div className="header__navitem">
                <a>통계</a>
                <ul className></ul>
            </div>
            <div className="header__navitem">
                <a>소식</a>
                <ul className></ul>
            </div>
        </nav>
    );
};

export default nav;
